import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee } from "@fortawesome/free-solid-svg-icons";

const Navbar = () => {
	return (
		<div className="bg-blue-200 h-16 flex-row">
			<FontAwesomeIcon
				className="flex text-4xl mt-3.5 ml-5"
				icon={faCoffee}
			/>
			<div>
				<ol>
					<li>
						<a href="/">Home</a>
					</li>
					<li>
						<a href="/">Add Transaction</a>
					</li>
					<li>
						<a href="/">DashBoard</a>
					</li>
					<li>
						<a href="/">Login</a>
					</li>
					<li>
						<a href="/">Register</a>
					</li>
					<li>
						<a href="/">Logout</a>
					</li>
				</ol>
			</div>
		</div>
	);
};

export default Navbar;
